import { useState } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import "bootstrap/dist/css/bootstrap.min.css";

// Lavender & brown palette
const PALETTE = {
  lavender_light: "#f3e8ff",
  lavender_main: "#b983ff",
  lavender_dark: "#7f53ac",
  brown_light: "#d2b48c",
  brown_main: "#8b4513",
  brown_dark: "#5c3317",
  accent: "#a084ca"
};

const DOG_MASCOT =
  "https://cdn.pixabay.com/photo/2016/03/31/19/14/dog-1298135_1280.png";

const Login = () => {
  const [data, setData] = useState({ email: "", password: "" });
  const [error, setError] = useState("");
  const handleChange = ({ currentTarget: input }) => {
    setData({ ...data, [input.name]: input.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const url = "http://localhost:8080/api/auth";
      const { data: res } = await axios.post(url, data);
      localStorage.setItem("token", res.data);
      window.location = "/";
    } catch (error) {
      if (
        error.response &&
        error.response.status >= 400 &&
        error.response.status <= 500
      ) {
        setError(error.response.data.message);
      }
    }
  };

  return (
    <div
      style={{
        minHeight: "100vh",
        background: `linear-gradient(135deg, ${PALETTE.lavender_light} 0%, ${PALETTE.brown_light} 100%)`,
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        overflow: "hidden",
        position: "relative"
      }}
    >
      <div
        className="card shadow-lg p-0 border-0"
        style={{
          maxWidth: 900,
          width: "100%",
          display: "flex",
          flexDirection: "row",
          borderRadius: 32,
          background: "rgba(255,255,255,0.7)",
          backdropFilter: "blur(16px)",
          boxShadow: `0 0 24px 0 ${PALETTE.lavender_main}33`
        }}
      >
        {/* Left: Mascot + Welcome */}
        <div
          className="d-none d-md-flex flex-column align-items-center justify-content-center p-5"
          style={{
            background: `linear-gradient(135deg, ${PALETTE.lavender_main} 0%, ${PALETTE.brown_light} 100%)`,
            borderTopLeftRadius: 32,
            borderBottomLeftRadius: 32,
            minWidth: 320,
          }}
        >
          <img
            src={DOG_MASCOT}
            alt="Dog Mascot"
            style={{
              width: 120,
              height: 120,
              objectFit: "contain",
              filter: `drop-shadow(0 0 16px ${PALETTE.lavender_main}99)`
            }}
          />
          <h2 className="mt-4 mb-2 fw-bold" style={{ color: PALETTE.brown_dark }}>
            Witaj w PuppyParadise!
          </h2>
          <p className="text-muted text-center" style={{ fontSize: 18 }}>
            Najlepszy salon dla Twojego pupila.<br />
            Zaloguj się i zadbaj o swojego psa!
          </p>
        </div>
        {/* Right: Login form */}
        <div
          className="flex-fill p-5"
          style={{
            minWidth: 320,
            borderTopRightRadius: 32,
            borderBottomRightRadius: 32,
            background: "#fff"
          }}
        >
          <form onSubmit={handleSubmit}>
            <h1 className="mb-4 fw-bold text-center" style={{ color: PALETTE.brown_main }}>
              Logowanie
            </h1>
            <input
              type="email"
              placeholder="Email"
              name="email"
              onChange={handleChange}
              value={data.email}
              required
              className="form-control mb-3 py-3"
              style={{
                borderColor: PALETTE.lavender_main,
                background: PALETTE.lavender_light,
                fontSize: 18,
                borderRadius: 16
              }}
            />
            <input
              type="password"
              placeholder="Hasło"
              name="password"
              onChange={handleChange}
              value={data.password}
              required
              className="form-control mb-3 py-3"
              style={{
                borderColor: PALETTE.brown_light,
                background: PALETTE.lavender_light,
                fontSize: 18,
                borderRadius: 16
              }}
            />
            {error && (
              <div
                className="alert alert-danger py-2"
                style={{
                  background: PALETTE.lavender_light,
                  color: PALETTE.brown_dark,
                  borderColor: PALETTE.brown_main,
                  borderRadius: 12
                }}
              >
                {error}
              </div>
            )}
            <button
              type="submit"
              className="btn w-100 mb-2 py-3 fw-bold"
              style={{
                background: `linear-gradient(90deg, ${PALETTE.brown_main} 0%, ${PALETTE.lavender_main} 100%)`,
                color: "#fff",
                fontSize: 20,
                border: "none",
                borderRadius: 16,
                boxShadow: `0 0 16px ${PALETTE.brown_main}33`
              }}
            >
              Zaloguj się
            </button>
          </form>
          <div className="text-center mt-4">
            <span style={{ color: PALETTE.brown_main, fontWeight: 500 }}>Nie masz konta?</span>
            <Link to="/signup" className="ms-2">
              <button
                type="button"
                className="btn"
                style={{
                  background: PALETTE.lavender_light,
                  color: PALETTE.brown_main,
                  border: `2px solid ${PALETTE.brown_main}`,
                  fontWeight: "bold",
                  borderRadius: 16,
                  boxShadow: `0 0 8px ${PALETTE.lavender_main}22`
                }}
              >
                Zarejestruj się
              </button>
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
